import React from "react";

function Footer() {
    return (
        <footer className="bg-gray-900 flex items-center justify-center h-32 font-serif">
            <div className="text-gray-200 ">Hotel101 &copy; 2020</div>
        </footer>
    );
}

export default Footer;
